import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
      <div className="drag-n-drop">
        <div className="dnd-group">
          <div className="dnd-item">
            <div><p>Item</p></div>
          </div>
          <div className="dnd-item">
            <div><p>Item 2</p></div>
          </div>
        </div>
      </div>
    </div>
  );
}

export default App;
